import React from 'react';
import ReactDom from 'react-dom';
import './index.css'
import App from './App';
import Box from '@mui/material/Box';
import Paper from '@mui/material/Paper';
import Stack from '@mui/material/Stack';
import BottomNavigation from '@mui/material/BottomNavigation';
import BottomNavigationAction from '@mui/material/BottomNavigationAction';
import RestoreIcon from '@mui/icons-material/Restore';
import FavoriteIcon from '@mui/icons-material/Favorite';
import LocationOnIcon from '@mui/icons-material/LocationOn';
import Chip from '@mui/material/Chip';
import CameraMaster from './Cameras';
import AegisMaster from './Aegis';
import CSSTransitionGroup from 'react-transition-group/CSSTransitionGroup';
import {Route,Switch, BrowserRouter as Router} from 'react-router-dom';


function Main(){
  return(
    <div>
        <App />
        <Links/>
    </div>
  )
}


function Links (){
  return(
  <div>
    <Stack spacing={2} direction="column" justifyContent="center" alignItems="flex-start">
    <Chip label="Home" component="a" href="/App" clickable />
    <Chip label="Cameras" component="a" href="/Cameras" clickable/>
    <Chip label="Upgrade Aegis" component="a" href="/Aegis" clickable/>
    </Stack>
      <CSSTransitionGroup
        transitionName="example"
        transitionAppear={true}
        transitionAppearTimeout={500}
        transitionEnter={true}
        transitionLeave={true}>
        <Router>
          <Switch>
            <Route path="/Cameras" component={CameraMaster}/>
            <Route path="/Aegis" component={AegisMaster}/>
          </Switch>
        </Router>
      </CSSTransitionGroup>
      <Box sx={{ width: 500 }}>
      <BottomNavigation
        showLabels
        value={value}
        onChange={(event, newValue) => {
          setValue(newValue);
        }}
      >
        <BottomNavigationAction label="Recents" icon={<RestoreIcon />} />
        <BottomNavigationAction label="Favorites" icon={<FavoriteIcon />} />
        <BottomNavigationAction label="Nearby" icon={<LocationOnIcon />} />
      </BottomNavigation>
    </Box>
  </div>
  )
}
export default App;
ReactDom.render(<Main/>,document.getElementById('root'))
